function Menu(){
    return(
        <div className="title">
            <h1 id="myIdentity">My Identity</h1> 
            <table class="menu">
                <tr><td>Créer une identité</td></tr>
                <tr><td>Toutes les identités</td></tr>
                <tr><td>Accéder à mon identité</td></tr>
            </table>
        </div>
    );
}
export default Menu;
